import Profil from './Profil'



class App extends Component {
   render(){
        return(
            <div className='pt-5'>
                <Profil info = {{ imgSrc : 'images/06.jpg',
                                  FullName : 'touati karim',
                                  bio : 'im a programmer',
                                  profession : 'programmer'}
                                } />
            </div>
        )
      }
}


export default App
